css:
@-moz-document regexp("http[s]?://[^/]*swarm.*")
{

:root
{
    --swarm-primary-background: rgb(26,29,33);
    --swarm-primary-foreground: rgb(209,210,211);
    --swarm-foreground-min: rgb(34,37,41);
    --swarm-foreground-low: rgb(53,55,59);
    --swarm-foreground-high: rgb(129,131,133);
    --swarm-foreground-max: rgb(171,171,173);
    --swarm-foreground-max-20: rgba(171,171,173,0.2);
    --swarm-foreground-max-40: rgba(171,171,173,0.4);
    --swarm-primary-highlight: rgb(29,155,209);
    --swarm-secondary-highlight: rgb(242,199,68);
    --swarm-alert-background: rgb(92,78,10);
    --swarm-alert-border: rgb(147,125,16);
    --swarm-alert-error-background: rgb(73,29,29);
    --swarm-alert-error-border: rgb(146,58,58);
    --swarm-input-required-invalid: rgb(239,95,91);
}

.com { color: #696d70; }
.kwd { color: #00a7aa; }
.lit { color: #a06fca; }
.pln { color: #d1d2d3; }
.pun { color: #fc4384; }
.str { color: #e6db74; }
.typ { color: #98e342; }



body,
body.route-login
{
    background-color: var(--swarm-primary-background);
    color: var(--swarm-primary-foreground);
}



code,
pre
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}



textarea,
textarea[disabled],
textarea[readonly]
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

input[type="text"],
input[type="password"]
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

.navbar-site li.search input,
.navbar-site li.search input:focus,
.navbar-site li.search input:valid
{
    background-color: var(--swarm-foreground-min);
}

input:focus:invalid:focus,
input:required:invalid,
select:required:invalid,
textarea:required:invalid
{
    border-color: var(--swarm-input-required-invalid);
    box-shadow: 0 0 6px var(--swarm-input-required-invalid);
}

.input-append .add-on,
.input-prepend .add-on
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}



.table .table
{
    background-color: var(--swarm-primary-background);
}

.table th,
.table td
{
    border-color: var(--swarm-foreground-min);
}

.table th
{
    color: var(--swarm-foreground-max);
}

.table-striped tbody>tr:nth-child(odd)>th,
.table-striped tbody>tr:nth-child(odd)>td
{
    background-color: var(--swarm-foreground-min);
}

.table-hover tbody tr:hover>th,
.table-hover tbody tr:hover>td
{
    background-color: var(--swarm-foreground-low);
}

.dashboard .table-striped th
{
    border-color: var(--swarm-foreground-low);
}

.dashboard .table-striped tr.empty td
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.table-bordered
{
    border-color: var(--swarm-foreground-low);
}

.tbody-bordered tbody tr td:first-child,
.tbody-bordered tbody tr td:last-child
{
    border-color: var(--swarm-foreground-low);
}



.MuiTable-root thead
{
    background-color: var(--swarm-foreground-min);
}

.MuiTable-root th,
.MuiTable-root td
{
    border-bottom-color: var(--swarm-foreground-low);
}

.MuiButton-root,
.MuiInputBase-root,
.MuiPaper-root,
.MuiTableCell-head,
.MuiTableCell-body,
.MuiTabs-root,
.MuiTypography-colorTextPrimary
{
    color: var(--swarm-primary-foreground);
}

.MuiFormLabel-root,
.MuiToolbar-root.filterBar .filterTitle
{
    color: var(--swarm-foreground-high);
}

.MuiButton-outlined
{
    border-color: var(--swarm-foreground-low);
}

.MuiInputBase-root input[type="text"],
.MuiInputBase-root input[type="password"]
{
    background-color: var(--swarm-primary-background);
}

.MuiInput-underline:before
{
    border-color: var(--swarm-foreground-low) !important;
}



.review-description,
.review-description:focus,
.review-description:hover
{
    color: var(--swarm-primary-foreground);
}

.userInfo
{
    color: var(--swarm-foreground-high) !important;
}

.userInfo span
{
    color: var(--swarm-primary-foreground) !important;
}



.modal
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.modal-header
{
    border-color: var(--swarm-foreground-low);
}

.modal-footer
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
    box-shadow: inset 0 1px 0 var(--swarm-foreground-high);
}

.close
{
    color: var(--swarm-primary-foreground);
}

.close:hover
{
    color: var(--swarm-foreground-max);
}



.navigation,
.navigation li,
.navigation li:hover,
.navigation .contextHeading
{
    background-color: var(--swarm-foreground-min);
}

.navbar-inverse .navbar-inner
{
    background-color: var(--swarm-foreground-low);
}

.nav-tabs
{
    border-color: var(--swarm-foreground-low);
}

.nav-tabs>.active>a
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

.nav-tabs>.active>a:hover,
.nav-tabs>.active>a:focus
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.nav>li>a:hover,
.nav>li>a:focus,
.navbar .nav>li>a:hover,
.navbar .nav>li>a:focus
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

.navbar .nav>.active>a
{
    color: var(--swarm-primary-foreground);
}



h1.page-heading
{
    background-color: var(--swarm-foreground-min);
    color: var(--swarm-foreground-max);
}

h1.page-heading span.page-id
{
    color: var(--swarm-primary-foreground);
}



.dashboardExplanation
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}



.popover.right .arrow:after
{
    border-right-color: var(--swarm-foreground-low);
}

.popover.change-info .arrow
{
    border-right-color: var(--swarm-foreground-low);
}

.popover.change-info .popover-title,
.popover.change-info .popover-footer
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
}

.popover.change-info .description-comments
{
    border-color: var(--swarm-foreground-low);
}



.change-header .change-info
{
    border-color: var(--swarm-foreground-low);
}

.review-wrapper .version-summary
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
}



.diff-header
{
    border-color: var(--swarm-foreground-low);
}

.diff-header-affix.affix
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.diff-wrapper.file-read .diff-header .diff-header-affix
{
    background-color: var(--swarm-foreground-min);
}

.diff-footer
{
    background-color: var(--swarm-foreground-min);
}

.diff-body
{
    border-color: var(--swarm-foreground-low);
}

.diff-body .line-num
{
    background-color: var(--swarm-foreground-low);
    color: var(--swarm-foreground-max);
}

.diff-body .line-num-right div.context-controls
{
    border-color: var(--swarm-foreground-low);
}

.diff-body.diff-sideways
{
    background-color: var(--swarm-foreground-min);
}

.diff-body .diff-type-meta .line-value
{
    background-color: var(--swarm-primary-background);
    background: linear-gradient(to bottom, var(--swarm-primary-background) 0, var(--swarm-primary-background) 45%, var(--swarm-foreground-max-20) 45%, var(--swarm-foreground-max-20) 55%, var(--swarm-primary-background) 55%, var(--swarm-primary-background) 100%);
}

.diff-body .diff-type-meta:hover td
{
    background-color: var(--swarm-foreground-low);
}

.diff-body .diff-type-meta:hover td.line-value
{
    background-color: var(--swarm-foreground-low);
    background: linear-gradient(to bottom, var(--swarm-foreground-low) 0, var(--swarm-foreground-low) 45%, var(--swarm-foreground-max-40) 45%, var(--swarm-foreground-max-40) 55%, var(--swarm-foreground-low) 55%, var(--swarm-foreground-low) 100%);
}

.diff-body.diff-sideways .diff-table
{
    background-color: var(--swarm-primary-background);
}

.diff-body.left-side .diff-type-add .line-value,
.diff-body .diff-type-add.diff-type-edit .line-value
{
    background-color: rgb(30,46,29);
}

.diff-body.right-side .diff-type-delete .line-value,
.diff-body .diff-type-delete.diff-type-edit .line-value
{
    background-color: rgb(26,34,49);
}

.comments-wrapper .comment-footer
{
    color: var(--swarm-foreground-high);
}

.comments-wrapper .comment-form .textarea-wrapper
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
}

.comments-container .closed-comments-wrapper,
.comments-container .comment-replies .comment-replies-wrapper,
.comments-wrapper .comment-form .textarea-tips,
.comments-wrapper .content-context,
.diff-footer .file-comments-handle,
.diff-footer .file-comments-section
{
    border-color: var(--swarm-foreground-low);
}

.comments-container .comments-table tr.read:not(.closed) td.comment-summary
{
    background: none !important;
}

.comments-container .comment-replies .comment-replies-wrapper.even,
.comments-wrapper .content-context .content-line-value,
.diff-footer .file-comments-section
{
    background-color: var(--swarm-primary-background);
}

.comments-container .closed-comments-header,
.comments-container .comment-replies .comment-replies-wrapper.odd
{
    background-color: var(--swarm-foreground-min);
}

.diff-body tr .line-value span.insert,
.diff-body .diff-type-add .line-value,
.comments-wrapper .content-line-value.content-line-add
{
    background-color: rgb(46,71,45);
}

.diff-body tr .line-value span.delete,
.diff-body .diff-type-delete .line-value,
.comments-wrapper .content-line-value.content-line-delete
{
    background-color: rgb(51,67,98);
}

.diff-body.diff-sideways .diff-type-edit .line-value
{
    background-color: rgb(28,21,38);
}

.diff-body.diff-sideways tr.diff-type-edit .line-value span.delete
{
    background-color: rgb(71,53,98);
}

.diff-body.diff-sideways tr.diff-type-edit .line-value span.insert
{
    background-color: rgb(71,53,98);
}

.diff-body tr.diff-type-meta
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}

.diff-body table tr.diff.diff-content:hover td span.insert,
.diff-body table tr.diff.diff-content:hover td span.delete
{
    background-color: var(--swarm-foreground-low) !important;
}

.diff-body table tr.diff.diff-content:hover td
{
    background-color: var(--swarm-foreground-min) !important;
}

.diff-body table tr.diff.diff-content:hover td.line-num
{
    color: var(--swarm-foreground-high);
}

.diff-body .context-controls .context-icon-container
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.diff-body .context-controls .context-icon-container:hover
{
    background-color: var(--swarm-foreground-low);
}



.btn,
.btn:active,
.btn:focus,
.btn.active,
.btn.disabled
{
    background-color: var(--swarm-foreground-min);
    color: var(--swarm-primary-foreground);
    text-shadow: none;
}

div[class*='toolbar'] .btn.active,
div[class*='toolbar'] .btn.active:focus,
.btn.active,
.btn.active:focus,
.btn-group.open .btn.dropdown-toggle
{
    background-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

.btn-primary
{
    background-color: var(--swarm-primary-highlight);
    color: #fff;
    text-shadow: none;
}

div[class*='toolbar'] .btn.active:hover,
.btn.active:hover
{
    background-color: var(--swarm-foreground-min);
    color: #fff;
}

div[class*='toolbar'] .btn:hover,
.btn:hover
{
    background-color: var(--swarm-foreground-low);
    color: #fff;
}



.slider .plot
{
    background-color: var(--swarm-foreground-low);
}

.slider .rev-dot
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.slider .rev:hover .rev-dot
{
    background-color: var(--swarm-primary-highlight);
}

.slider .marker-dot
{
    background-color: var(--swarm-primary-highlight);
    border-color: var(--swarm-primary-highlight);
}

.slider .connector
{
    background-color: var(--swarm-foreground-min);
}



.dropdown-menu
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
    color: var(--swarm-primary-foreground);
}

.dropdown-menu>li>a
{
    color: var(--swarm-primary-foreground);
}

.dropdown-menu .divider
{
    background-color: var(--swarm-foreground-low);
    border-color: var(--swarm-foreground-low);
}



.profile-info .body
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}

.profile-info .metrics li
{
    color: var(--swarm-foreground-high);
}

.profile-info .metrics li .count
{
    color: var(--swarm-primary-foreground);
}



.profile-navbar
{
    background-color: var(--swarm-foreground-min);
}

.profile-navbar .brand
{
    color: var(--swarm-primary-foreground);
}



.projects .tab-pane .project-cell .content,
.workflows .tab-pane .workflow-cell .content,
.test-definitions .tab-pane .test-definition-cell .content
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}

.add-test-definition .modal-footer,
.add-workflow .modal-footer
{
    background-color: var(--swarm-primary-background);
}

.add-test-definition .control-group-test-definition-values,
.add-workflow .control-group-workflow-rules,
.add-workflow .control-group-workflow-tests,
.add-workflow form.global-workflow .control-group-workflow-rules,
.add-workflow form.global-workflow .control-group-workflow-tests
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}

.add-workflow .control-group-workflow-tests .tests-title
{
    border-color: var(--swarm-foreground-low);
}

#affected-projects,
#affected-workflows
{
    background-color: var(--swarm-foreground-min);
    border-color: var(--swarm-foreground-low);
}


#actionable-reviews-filter-bar
{
    border-color: var(--swarm-foreground-low);
}

.alert
{
    background-color: var(--swarm-alert-background);
    border-color: var(--swarm-alert-border);
    color: var(--swarm-primary-foreground);
    text-shadow: none;
}

.alert-danger,
.alert-danger h4,
.alert-error,
.alert-error h4,
.error
{
    background-color: var(--swarm-alert-error-background);
    border-color: var(--swarm-alert-error-border);
    color: var(--swarm-primary-foreground);
}

.message
{
    color: var(--swarm-foreground-high);
}

.badge
{
    background-color: var(--swarm-foreground-low);
}

.breadcrumb>li
{
    text-shadow: none;
}

.change-files
{
    border-color: var(--swarm-foreground-low);
}

.file-metrics b
{
    color: var(--swarm-foreground-max);
}

.login-panel
{
    background-color: var(--swarm-foreground-min);
}

#notificationTable.table-striped>tbody>tr:nth-child(odd)>th,
#notificationTable.table-striped>tbody>tr:nth-child(odd)>td
{
    background-color: var(--swarm-foreground-min);
}

#notificationTable tr.level1,
#settingsTable tr.toprow,
#groupNotificationSettingPanel tbody th
{
    border-color: var(--swarm-foreground-low);
}

#notifications .preferencesBox,
#settings .preferencesBox
{
    background-color: var(--swarm-primary-background);
    border-color: var(--swarm-foreground-low);
}

.projects-sidebar tbody
{
    background-color: var(--swarm-foreground-min);
}



.prettyprint
{
    background-color: var(--swarm-primary-background);
}

.prettyprint.linenums
{
    box-shadow: inset 55px 0 0 var(--swarm-foreground-min), inset 56px 0 0 var(--swarm-foreground-low);
}

.tab-pane .view
{
    border-color: var(--swarm-foreground-low);
}

ol.linenums li
{
    color: var(--swarm-foreground-high);
    text-shadow: none;
}



/* Focus within to display comments which have been marked as read. */
.comments-container .comments-table tr:focus-within.read .content-context,
.comments-container .comments-table tr:focus-within.read .comment-body,
.comments-container .comments-table tr:focus-within.read .comment-attachments,
.comments-container .comments-table tr:focus-within.read .comment-footer,
.comments-container .comments-table tr:focus-within.read .avatar a
{
    display: block !important;
}



::-webkit-scrollbar
{
    width: 12px;
    height: 12px;
}

::-webkit-scrollbar-corner
{
    background: var(--swarm-foreground-min);
}

::-webkit-scrollbar-track
{
    background: var(--swarm-foreground-min);
}

::-webkit-scrollbar-thumb
{
    background: var(--swarm-foreground-low);
    border-radius: 6px;
}



.svgIcon
{
    fill: var(--swarm-foreground-max);
}

.moreBoxBorder
{
    fill: var(--swarm-foreground-min);
}

.moreBox
{
    fill: var(--swarm-foreground-low);
}

.moreDot
{
    fill: var(--swarm-foreground-high);
}



.diff-body .diff-nav-focus-start,
.diff-body .diff-nav-focus-start>td,
.diff-body .diff-nav-focus-start>td>span,
.diff-body .diff-nav-focus-end,
.diff-body .diff-nav-focus-end>td,
.diff-body .diff-nav-focus-end>td>span,
.diff-body .diff-nav-focus-start.diff-nav-focus-end,
.diff-body .diff-nav-focus-start.diff-nav-focus-end>td,
.diff-body .diff-nav-focus-start.diff-nav-focus-end>td>span
{
    background-image: url(data:image/gif;charset=utf-8;base64,R0lGODlhAQABAIAAAAAAAP///yH/C05FVFNDQVBFMi4wAwEAAAAh+QQEAAAAACwAAAAAAQABAAACAkwBADs=),url(data:image/gif;charset=utf-8;base64,R0lGODlhAQABAIAAAAAAAP///yH/C05FVFNDQVBFMi4wAwEAAAAh+QQEAAAAACwAAAAAAQABAAACAkwBADs=);
}

[class^="icon-"], [class*=" icon-"],
.diff-body tr.diff.has-comments td:first-child:after,
.diff-wrapper.has-comments .diff-header .diff-toolbar:before
{
    background-image: url(data:image/png;base64,);
}

.review-version-chooser select,
.review-version-chooser select:hover,
.review-version-chooser select:active,
.review-version-chooser select:focus
{
    background-image: url(data:image/png;base64,);
}

.swarm-icon
{
    background-image: url(data:image/png;base64,);
}

.icon-svg-refresh
{
    background-image: url(data:image/svg+xml;base64,);
}

}
